import React, {useState} from 'react'
import classes from './ColorPicker.module.css'


const ColorPicker = ({ children, onChange, ...props }) => {
    const [color, setColor] = useState(null);
    console.log(color);  
    return (
        <div>
            <input {...props} onChange={e => setColor(e.target.value)} value={color} className={classes.myColorPicker} type="color" />
        </div>

    )
}

export default ColorPicker
